import React from "react";
import Img from '../assets/image 1.png';
import Less from '../assets/less.png'
import './Navbar.css'
function Navbar(){
    return(
       <div className="Par"> 
        <div className="front">
           <img onClick={()=>handleRedirect('../pages/Header')} style={{margintop:"13px"}} className="less" src={Less} alt="" /> 
           <img style={{width:"25vw",height:"5vh"}} className="bus" src={Img} alt="" />

        </div>
        <hr/>
       </div>
    )
}

export default Navbar;
